import React from 'react';
import { Container, Col } from 'react-bootstrap';

const Topbar = () => {
  return ( 
    <div>
      <h1>Hello World!</h1>
    </div>
   );
}


export default function Cover() {
  return (
    <Col md={9} style={{background: "white"}}>
        <Container>
            <h1>Projects</h1>
            <Topbar />
        </Container>
    </Col>
  )
}
